import React, { Component } from 'react';

class Pokemon extends Component {

    attack = (move) => {
        this.props.sendAttack(this.props.name, move);
    }

    render() {
        return(
            <div>
              
               

                <ul >
                    <li><button onClick={() => this.attack(this.props.moves.move_1)}>55555</button></li>
                    <li><button onClick={() => this.attack(this.props.moves.move_2)}>666</button></li>
                </ul>
            </div>
        )
    }
}

export default Pokemon;
